import React from 'react';

const VadResults = ({ timestamps }) => {
    return (
        <div>
            <h3>VAD Results:</h3>
            <ul>
                {timestamps.map((timestamp, index) => (
                    <li key={index}>
                        Start: {timestamp[0]} ms, End: {timestamp[1]} ms
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default VadResults;
